  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0109928 includes chemical,
  meteorological, physical and underway - surface data collected from EXPLORER OF
  THE SEAS in the Caribbean Sea and North Atlantic Ocean from 2008-02-13 to 2008-12-11
  and retrieved during cruise 33KF20080213 (EX0801), 33KF20080817 (EX0824) and 33KF20081201
  (EX0839). These data include ALKALINITY, BAROMETRIC PRESSURE, CARBON DIOXIDE - AIR,
  CARBON DIOXIDE - PARTIAL PRESSURE - DIFFERENCE, DISSOLVED INORGANIC CARBON, Partial
  pressure (or fugacity) of carbon dioxide, SALINITY, SEA SURFACE TEMPERATURE and
  WATER TEMPERATURE. The instruments used to collect these data include Carbon dioxide
  (CO2) gas analyzer and Shower head chamber equilibrator for autonomous carbon dioxide
  (CO2) measurement. These data were collected by Rik Wanninkhof of US DOC; NOAA;
  OAR; Atlantic Oceanographic and Meteorological Laboratory as part of the VOS Explorer
  of the Seas Lines 2008 data set.nnThe Global Volunteer Observing Ship (VOS) Program
  is coordinated by the UNESCO International Ocean Carbon Coordination Project (IOCCP).
  International groups from 14 countries have been outfitting research ships and commercial
  vessels with automated CO2 sampling equipment to analyze the carbon exchange between
  the ocean and atmosphere.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
